import React from "react";
import '../style.css';

const Home = () => {
    return (
        <div className="Home">
            <div className="leftPanel">
                <div className="Logo">RAFEEQ WEIDEMAN</div>
                <div>
                    <ul>
                        <li>Welcome</li>
                        <li>About Me</li>
                        <li>What I Do</li>
                        <li>Get In Touch</li>
                    </ul>
                </div>
            </div>
            <div className="rightPanel"></div>
        </div>
    )
}

export default Home;
